import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ background:blue, height: 300, clear: "both", paddingTop: 120, textAlign: "center" }}
      className="jumbotron bg-dark text-white "
    >
      {children}
    </div>
  );
}

export default Jumbotron;
